INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (8, N'Різдвяний Вертеп', CAST(N'2018-08-20T19:39:33.2852814' AS DateTime2), N'Різдвяний Вертеп у виконанні учнів Долинської гімназії №1', N'Різдвяний Вертеп у виконанні учнів Долинської гімназії №1 (керівник Котович І.І.) – це філігранна майстерність і натхненні перевтілення дітей, які створили цілу галерею яскравих образів. Але найголовнішою родзинкою виступу є атмосфера – сонячна, світла і дуже добра.', N'')
