INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (9, N'Посвята у читачі', CAST(N'2018-08-20T19:43:30.9700000' AS DateTime2), N'Бібліотека - це той храм, де завжди зберігається духовність.', N'Бібліотека - це той храм, де завжди народжується і зберігається духовність. Пам''ятаймо, що у давнину бібліотеку називали «дім життя», «притулок мудрості», «аптека для душі». (Сухомлиньский В.) 
     Кожен з нас може знайти в бібліотеці спокій духу, розраду в смутку, моральне оновлення і щастя, якщо тільки вміє «володіти тим дорогоцінним ключем», який відмикає таємничу дверку цієї скарбниці.
     Читайте! І нехай у вашому житті не буде жодного дня коли  б ви не прочитали хоча б сторінки з нової книги.', N'')
GO
INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (11, N'Шевченківські дні', CAST(N'2018-08-20T19:46:24.6490000' AS DateTime2), N'У Долинській гімназії №1 щороку вшановують Кобзаря', N'Воістину феноменальна особистість. Він вийшов з мужицької хати, а став символом нації. Він був сиротою, проте кожне його слово присвячене неньці-Україні. Йому не дісталося у спадок від батька нічого - він же залишив майбутнім поколінням неоціненний скарб - Слово.

У Долинській гімназії №1 щороку вшановують славетного Кобзаря. Яскравим акордом зазвучала літературно- музична композиція "Іду з дитинства до Тараса". Кореспонденти 10-А класу мали можливість наживо спілкуватися з Тарасом Шевченком. Скажете, це нереально? У чарівному світі літератури часто трапляються дива. Учні скористалися машиною часу й опинились у 19 столітті... На святі лунали поезії, що стали піснями. Заворожував глядачів чарівний дитячий спів, що переносив усіх у той чарівний весняний сад ("Садок вишневий коло хати"), що спонукав побачити оту прекрасну зіроньку ( "Зоре моя вечірняя"). Під час вікторини гімназисти мали можливість продемонструвати свої знання. Проте найбільше хвилювалися сьогодні конкурсанти, які боролися за звання найкращого декламатора поезії Тараса Григоровича. Опісля журі вручило усім читцям віршів грамоти. Такою ж грамотою нагороджено режисера цього дійства - бібліотекаря Лаврів Галину Богданівну. Так давно Шевченко переступив поріг вічності, проте його поезія актуальна й сьогодні, бо адресована "і мертвим, і живим, і ненародженим"…', N'')
GO
INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (12, N'Кенгуру 2018', CAST(N'2018-08-20T19:48:34.6330000' AS DateTime2), N'Міжнародний математичний конкурс "Кенгуру"', N'Міжнародний математичний конкурс "Кенгуру" - це математичне та інтелектуальне змагання серед школярів нашої держави. Гра цікава як призерам Всеукраїнських олімпіад із різних предметів, так і тим, хто лише починає засвоювати ази цієї чудової науки – математики. Талановиті, працьовиті та яскраві - так можна охарактеризувати учнів Долинської гімназії №1, які взяли участь у Міжнародному етапі конкурсу «Кенгуру»!!! ', N'')
GO
INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (13, N'Гості гімназії', CAST(N'2018-08-20T19:50:12.9210000' AS DateTime2), N'В Долинську гімназію завітали ліцеїсти Києво-Печерського ліцею', N'29 березня в Долинську гімназію завітали ліцеїсти Києво-Печерського ліцею №171 "Лідер". На початку зустрічі директор гімназії Макосій В.Б. презентував присутнім історію закладу, ознайомив із його структурою та навчально-матеріальною базою. Зустріч відбувалася в теплій дружній атмосфері. Активно пройшло знайомство учасників під час тренінгу "Дерево дружби". Вразили вчителів дитячі очікування від перебування в гімназії: більше дізнатися про західний регіон України та відвідати маловідомі куточки Прикарпаття, щоб побачити мальовничу красу української природи, відчути неперевершений колорит рідного краю, знайти нових друзів. Діти ділилися враженнями та дякували за надану можливість поспілкуватися. Ліцеїсти отримали на згадку про Долину подарунки. Сподіваємося, що в гостей залишаться приємні спогади про зустріч із Долинщиною, адже разом із гімназистами підготували великодні листівки , у яких є найкраще побажання:"Миру неньці Україні!"', N'')
GO
INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (14, N'Руханка 2018', CAST(N'2018-08-20T21:25:26.2275102' AS DateTime2), N'Навчаймо наших дітей цінувати те, що не продається , не купується', N'Бруно Ферреро : "Люди марнують здоров''я, заробляючи гроші, а потім витрачають гроші, намгаючись повернути здоров''я..."
16 квітня - Всесвітній день здоров''я. А на подвір''ї Долинської гімназії №1 - руханка ! 
Навчаймо наших дітей цінувати те, що не продається , не купується , те, що не можна вкрасти чи позичити .... ЗДОРОВ''Я ', N'')
GO
INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (15, N'День вишиванки', CAST(N'2018-08-20T21:27:34.8112947' AS DateTime2), N'Вишиванка об''єднує, адже сьогодні, 17 травня, уся Україна...', N'Вишиванка об''єднує, адже сьогодні, 17 травня, уся Україна барвисто розквітла зеленими, червоними, жовтими, блакитними кольорами. Кожен своїм вбранням засвідчив світу: " Я - українець!" Вулиці міст ураз стали подіумами, на яких перехожі демонструють те чарівне, створене теплими маминими руками шиття, у якому закодовано любов до рідного, ніжність до найдорожчого. Учні Долинської гімназії №1 теж відзначали День вишиванки. Погляньте на фото - і ви побачите, що це свято душі й серця. Це мистецтво. Жити. Радіти. Любити. Дякувати Богу за кожен захід і схід! Слава Україні!', N'')
GO
INSERT [dbo].[News] ([Id], [Title], [DateOfPost], [ShortDescription], [LongDescription], [Photo]) VALUES (16, N'Останній дзвоник ', CAST(N'2018-08-20T21:30:57.6300000' AS DateTime2), N'Закінчився навчальний рік і в нашій Долинській гімназії №1...', N'У травні, коли розквітають яскраві квіти і дзвенить пташиний спів, теплий весняний вітер приносить до нас свято Останнього дзвоника.
Закінчився навчальний рік і в нашій Долинській гімназії №1. Цей рік для закладу був незвичайним, адже ознаменувався перемогами та високими досягненнями в різних напрямках виховної та навчальної роботи.
Сьогодні дзвоник востаннє пролунав для наших 17 випускників – одинадцятикласників, які подарували присутнім танцювальний флешмоб.
', N'')
